import React from "react";

const cars = [
  {
    id: 1,
    name: "Ferrari F40",
    price: "1,200,000 ₪",
    description: "קלאסית איטלקית עם מנוע V8 כפול טורבו.",
    speed: '320 קמ"ש',
    owner: "יד 2",
    image: "/images/ferrari-f40.jpg",
  },
  {
    id: 2,
    name: "Lamborghini Aventador",
    price: "2,500,000 ₪",
    description: "יצירת מופת מודרנית עם מנוע V12.",
    speed: '350 קמ"ש',
    owner: "יד 1",
    image: "/images/lamborghini-aventador.jpg",
  },
];

const CarsForSale = () => {
  return (
    <div className="cars-container">
      <h2>מכוניות למכירה</h2>
      <div className="cars-list">
        {cars.map((car) => (
          <div key={car.id} className="car-card">
            <img src={car.image} alt={car.name} />
            <h3>{car.name}</h3>
            <p>
              <strong>תיאור:</strong> {car.description}
            </p>
            <p>
              <strong>מהירות מקסימלית:</strong> {car.speed}
            </p>
            <p>
              <strong>בעלות:</strong> {car.owner}
            </p>
            <p>
              <strong>מחיר:</strong> {car.price}
            </p>
            <button>קנה עכשיו</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CarsForSale;
